import React from 'react';
import './App.css';
import Cards from './Cards.jsx'
import Pokemons from './data';


class App extends React.Component {
  render (){
  return (
    <div className="App">
        <h1> Pokedex </h1>
        <Cards pokemons={Pokemons}/>
    </div>
  );
  }
}

export default App;
